  fish pathology, and other data from net, bottle casts, and fish trawls in the Lower
  Cook Inlet and other locations from NOAA Ship DISCOVERER and other platforms as
  part of Outer Continental Shelf Environmental Assessment Program (OCSEAP) from 1975-09-12
  to 1976-06-01 (NODC Accession 7601874)\",\n\t\"tracking_summary\": {\n\t\t\"total\":
