  [],\n\t\"revision_timestamp\": \"2016-09-05T21:55:06.811691\",\n\t\"name\": \"phytoplankton-fish-pathology-and-other-data-from-net-bottle-casts-and-fish-trawls-in-the-lower-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Phytoplankton, fish pathology, and other
  data were collected from net, bottle casts, and fish trawls in the Lower Cook Inlet
  and other locations from NOAA Ship DISCOVERER and other platforms from 12 September
  1975 to 01 June 1976. Data were collected by the National Marine Fisheries Service
  (NMFS) as part of Outer Continental Shelf Environmental Assessment Program (OCSEAP).
  Data were processed by NODC to the NODC standard F028 Phytoplankton and the F013
  Fish Pathology formats. Full format descriptions are available from the NODC homepage
  at www.nodc.noaa.gov/. An analog file for this accession is available from NODC
  user services.nnThe F028 format is used for data from the sampling and analysis
  of marine phytoplankton. Information on phytoplankton abundance, distribution, and
  productivity derived from these data support studies of marine populations and ecosystems.
  Data reported may include: position, date, and time of sampling; bottom depth and
  sampling depths; volume of water filtered; and concentration of cells, carbon concentration,
  wet and dry weight, and counts for each species reported. Comments may be relayed
  in a text record.nnThe F013 format is used for data from examinations of diseased
  fishes. Although these data may be from field observations, they derive primarily
  from laboratory analyses. Data include: location, and fishing duration, distance,
  and gear; catch statistics (e.g., total weight, number of individuals, age group,
  identity of diseases, and number of diseased individuals) by species for any number
  of species; and biological condition of selected specimens. The size, affected organ,
  location, and frequency of lesions may be reported for individual specimens. Specimens
  are identified with the NODC Taxonomic Code. These data may be characteristics of
  individual lesions or average lesion statistics.\",\n\t\"license_title\": null,\n\t\"extras\":
